&amp;lt;p&amp;gt;Although previous research highlights the complementary relationship of learning design with TPACK, this is not the case for TPACK informing the development of digital learning design tools. In this paper, we present PeerLAND (Peer Evaluation of LeArNingDesigns). This learning design tool interweaves design and peer evaluation in an integrated process based on TPACK, promoting teachers’ roles as designers and reviewers. It adopts a modular design approach to support teachers as designers explicitly represent their design ideas starting from pedadogical content knowledge and gradually cultivating all the TPACK knowledge domains. The learning design process ends with peer evaluation where teachers use TPACK-based criteria to provide constructive feedback to peers. We report on a study conducted in a teacher education context to evaluate PeerLAND. Specifically, we investigate: (i) how student teachers’ knowledge develops through the learning design process supported by PeerLAND, and (ii) how they value peer evaluation through PeerLAND. Our findings suggest that putting TPACK into action through PeerLAND developed student teachers’ knowledge in every TPACK domain, except for content knowledge. Furthermore, peer evaluation is considered advantageous to student teachers for getting timely constructive feedback and refining their designs, and several ideas for improving the peer evaluation mechanism are proposed.&amp;lt;/p&amp;gt;
&amp;lt;p&amp;gt;&amp;lt;em&amp;gt;Implications for practice or policy:&amp;lt;/em&amp;gt;&amp;lt;/p&amp;gt;
&amp;lt;ul&amp;gt;
&amp;lt;li&amp;gt;PeerLAND is an online tool supporting the development and peer evaluation of technology-enhanced learning designs allowing teachers to work together and switch roles between designers and reviewers.&amp;lt;/li&amp;gt;
&amp;lt;li&amp;gt;The learning design process in PeerLAND is a ready to use, step by step process for training teachers in technology-enhanced learning design. It provides a replicable blueprint for organising curricula.&amp;lt;/li&amp;gt;
&amp;lt;/ul&amp;gt;
